(442, 'Ïðàâèëà ïîäà÷è æàëîáû: \r<BR>\r<BR>- Æàëîáû íå ïî ôîðìå óäàëÿþòñÿ áåç ïðåäóïðåæäåíèÿ \r<BR>- Åñëè â æàëîáå ñîäåðæàòñÿ íåöåíçóðíûå èëè ãðóáûå âûðàæåíèÿ, æàëîáà áóäåò óäàëåíà áåç ðàññìîòðåíèÿ, âèíîâíûé áóäåò ñòðîãî íàêàçàí\r<BR> - Ïîâòîðíûå æàëîáû ñ÷èòàþòñÿ ôëóäîì, ê ôëóäó - ïðèíèìàþòñÿ ìåðû. \r<BR>- Êàæäàÿ æàëîáà ðàññìàòðèâàåòñÿ òîëüêî îäèí ðàç. \r<BR>- Åäèíñòâåííûì äîêàçàòåëüñòâîì çàêëÿòèÿ ìîë÷àíèÿ, íàëîæåííîãî ïî îøèáêå, õàìñòâà ñî ñòîðîíû Ïàëà÷à, óãðîç è ò.ä. ÿâëÿåòñÿ òîëüêî è èñêëþ÷èòåëüíî ñêðèíøîò ÷àòà. Êîïèÿ ÷àòà â òåêñòîâîì âèäå íå ÿâëÿåòñÿ äîêàçàòåëüñòâîì è áóäåò èãíîðèðîâàòüñÿ.\r<BR> - Æàëîáû îò òðåòüèõ ëèö ðàññìàòðèâàòüñÿ íå áóäóò, à ëèöà èõ ïîäàâøèå áóäóò íàêàçàíû çà ôëóä â ðàáî÷åì òîïèêå.\r<BR> - Âñå çàÿâêè áóäóò óäàëåíû ÷åðåç íåäåëþ ïîñëå ðàññìîòðåíèÿ. \r<BR>\r<BR>Ôîðìà ïîäà÷è æàëîáû: \r<BR>1. Íèê ïîäàþùåãî æàëîáó \r<BR>2. Íèê ïàëà÷à ñîñòîÿùåãî â Îðäåíå Ñâåòà, íàðóøèâøåãî Óñòàâ, Çàêîí èëè Âàøè Ïðàâà\r<BR> 3. Îïèñàíèå íàêàçàíèÿ è åãî ñðîê \r<BR>4. Ñóòü ïðîáëåìû, äîêàçàòåëüñòâà â âèäå ñêðèíøîòîâ \r<BR>\r<BR>Âíèìàíèå! Æàëîáû ïîäàííûå íå ïî ôîðìå áóäóò óäàëÿòüñÿ â òå÷åíèå ñóòîê! \r<BR>\r<BR>***Çà ôëóä â ðàçäåëå áóäóò óñòàíîâëåíû ñëåäóþùèå íàêàçàíèÿ: \r<BR>\r<BR>1) ìîë÷àíêà íà 24 ÷àñà \r<BR>2) Çà ïîâòîðíûé ôëóä - ìîë÷àíêà íà 24 ÷àñà + òþðüìà íà 24 ÷àñà \r<BR>------------------------------------------------------------------------------------\r<BR> \r<BR>Êàê ñäåëàòü ñêðèí ÷àòà : \r<BR>Äëÿ ïîëüçîâàòåëåé Windows. \r<BR>Øàã 1. Íàæèìàåì êëàâèøó Print Screen (PrintScr). \r<BR>Øàã 2. Îòêðûâàåì Paint (âñòðîåííûé â Windows ãðàôè÷åñêèé ðåäàêòîð). \r<BR>Øàã 3. Íàæèìàåì ñî÷åòàíèå êëàâèø Ctrl + V (èëè æå â ìåíþ Edit(Ïðàâêà) Paste(Âñòàâèòü))\r<BR> Øàã 4. Ñîõðàíèòü êàê... (Save as...) Âûáèðàåì ôîðìàò JPEG (*.jpg, *.jpeg) \r<BR>Øàã 5. Îòïðàâëÿéòå ñêðèíøîò íà óêàçàííûé ïàëà÷îì ïî÷òîâûé àäðåñ. \r<BR>', 127, 'OBITEL', 1, 0, 10, '', '', 11, '2013-02-24 01:09:45'),
(443, 'Qanun Keshikchileri oz vezifelerini icra ederken her hansi bir qehramana qarshi yalnish ceza tetbiq ediblerse ve ya shexsiqerezlik, prinsip apariblarsa o zaman qehramanin hakqi varki subutlu shekilde (Print-Screen) istenilen Qanun Keshikchisinden shikayyet erizesi yazsin. Qanun pozuntusu toredilen zaman qehraman mutleq “Print-Screen”-nin komekliyi ile qanun pozuntusunu suput edecek “screen”-i hazirlamalidir ve shikayyet erizesine elave etmelidir.\r<BR> \r<BR>Microsoft Windows idaretme sistemi altinda ishleyen butun standart klaviaturalarda (Keyboard) “PrintScreen” duymesi movcutdur.\r<BR> \r<BR>“Print-Screen” –den nece isdifade etmeli ? \r<BR>\r<BR>Lazim olan goruntu uzerinde “PrintScreen” duymesini basaraq shekili muvqqeti yadasha kechirsiniz ve daha sonra her hansi qrafik redakte proqrami acharaq “mouse” -un sag duymesindeki menyudan “Past” (âñòàâèòü) ve ya klaviaturalarda ctrl+v duymelerini basaraq hemin proqramin bosh seifesine elave ede bilersiz. Daha sonra hazirladiginiz “file” -ni hemin proqramda “Save as” (Ñîõðàíèòü êàê) menyusunun komekliyi ile GIF ve ya JPEG qrafik formatlarindan birini secherek daimi yaddasha saxlaya bilersiniz.\r<BR> \r<BR>“Screen” -i hazirlamaq uchun en rahat ve asant qrafik redakte proqrami “Paint” -dir.\r<BR> Start (Ïóñê) –&gt;&gt;Ïðîãðàììû–&gt;&gt;Ñòàíäàðòíûå–&gt;&gt;Paint ardicilligindan ve ya en tez ardicilliq Start (Ïóñê) –&gt;&gt; Run (Âûïîëíèòü) –&gt;&gt; mspaint yazaraq “Paint” proqramini acha bilersiniz.\r<BR> \r<BR>E R I Z E: \r<BR>\r<BR>1. Shikatetchi oldugunuz “Ñòðàæè ïîðÿäêà” -nin Nik-i \r<BR>2. Linki, http://www.oldbatle.com/info.php?log=nik \r<BR>3. Tetbiq olunmush ceza ve sebebi \r<BR>4. \\\\\\&quot;Screen\\\\\\&quot; -nin gonderilmesi baresinde melumat. \r<BR>5. Shikayyetin esasi. \r<BR>\r<BR>Hazirlanmish “Screen” –leri oldbatle.com@inbox.ru elektron unvanina gonderin ve mektubun movzusuna “Screen” –le yaniashi erizenin suretinide qeyd edin.\r<BR> \r<BR>DIQQETLI OLUN ! \r<BR>\r<BR>Eger hazirladiginiz erize yuxar