(488, 'Microsoft Windows idar&amp;#601;etm&amp;#601; sistemi altinda i&amp;#351;l&amp;#601;y&amp;#601;n b&amp;#252;t&amp;#252;n standart klaviaturalarda (Keyboard) “PrintScreen” (PRT SC) d&amp;#252;ym&amp;#601;si m&amp;#246;vc&amp;#252;tdur. \r<BR>\r<BR>“Print-Screen” –d&amp;#601;n nec&amp;#601; istifad&amp;#601; etm&amp;#601;li ? \r<BR>\r<BR>Lazim olan g&amp;#246;r&amp;#252;nt&amp;#252; &amp;#252;z&amp;#601;rind&amp;#601; “PrintScreen” d&amp;#252;ym&amp;#601;sini basaraq &amp;#351;&amp;#601;kili m&amp;#252;v&amp;#601;qq&amp;#601;ti yadda&amp;#351;a ke&amp;#231;irirsiniz v&amp;#601; daha sonra h&amp;#601;r hansi qrafik redakte proqrami a&amp;#231;araq “mouse” -un sa&amp;#287; d&amp;#252;ym&amp;#601;sind&amp;#601;ki meny&amp;#252;dan “Past” (âñòàâèòü) ve ya klaviaturalarda ctrl+v d&amp;#252;ym&amp;#601;l&amp;#601;rini basaraq h&amp;#601;min proqramin bo&amp;#351; s&amp;#601;hif&amp;#601;sin&amp;#601; elav&amp;#601; ed&amp;#601; bil&amp;#601;rsiz. Daha sonra haz&amp;#305;rlad&amp;#305;g&amp;#305;n&amp;#305;z “file” -ni h&amp;#601;min proqramda “Save as” (Ñîõðàíèòü êàê) meny&amp;#252;sunun kom&amp;#601;kliyi il&amp;#601; GIF v&amp;#601; ya JPEG qrafik formatlarindan birini se&amp;#231;&amp;#601;r&amp;#601;k daimi yadda&amp;#351;a saxlaya bil&amp;#601;rsiniz. \r<BR>\r<BR>“Screen” -i hazirlamaq &amp;#252;&amp;#231;&amp;#252;n &amp;#601;n rahat ve asant qrafik redakte proqrami “Paint” -d&amp;#305;r. \r<BR>\r<BR>Start (Ïóñê) –&gt;&gt;Ïðîãðàììû–&gt;&gt;Ñòàíäàðòíûå–&gt;&gt;Paint ard&amp;#305;c&amp;#305;l&amp;#305;&amp;#287;&amp;#305;ndan v&amp;#601; ya &amp;#601;n tez ardic&amp;#305;l&amp;#305;q \r<BR>Start (Ïóñê) –&gt;&gt; Run (Âûïîëíèòü) –&gt;&gt; mspaint yazaraq “Paint” proqram&amp;#305;n&amp;#305; a&amp;#231;a bil&amp;#601;rsiniz. \r<BR>\r<BR>_____________________________________________________________ \r<BR>\r<BR>Âî âñåõ ñòàíäàðòíûõ êëàâèàòóðàõ(Keyboard) êîòîðûå ðàáîòàþò ïîä ñèñòåìîé óïðàâëåíèÿ Microsoft Windows åñòü êíîïêà \\&quot;PrintScreen\\&quot; (PRT SC) \r<BR>\r<BR>Êàê ïîëüçîâàòüñÿ \\&quot;Print-Screen\\&quot; - îì \r<BR>\r<BR>Íàä íóæíûì èçîáðàæåíèåì íàæàâ êíîïêó \\&quot;PrintScreen\\&quot; âû ïåðåíåñåòå ôîòîãðàôèþ âî âðåìåííóþ ïàìÿòü,çàòåì îòêðûâ êàêóþ íèáóäü ïðîãðàììó ãðàôè÷åñêîãî ðåäàêòèðîâàíèÿ è íàæàâ â êëàâèàòóðå ctrl+v èëè âûáðàâ â ìåíþ êíîïêó âñòàâèòü êîòîðóþ âû ìîæåòå íàéòè íàæàâ íà ïðàâóþ êíîïêó \\&quot;ìàóñà\\&quot; âû ìîæåòå äîáàâèòü èçîáðàæåíèå â ïóñòóþ ñòðàíèöó.Ïîòîì âû ìîæåòå ñîõðàíèòü ýòîò ôàéë â ïîñòîÿííóþ ïàìÿòü ñ ïîìîùüþ ìåíþ \\&quot;save as\\&quot; (ñîõðàíèòü êàê) â ôîðìàòå GIF èëè JPEG ïî ñâîåìó âûáîðó \r<BR>\r<BR>Ñàìàÿ óäîáíàÿ ïðîãðàììà ãðàôè÷åñêîãî ðåäàêòèðîâàíèÿ äëÿ ïîäãîòîâêè \\&quot;Ñêðèí\\&quot;-à ýòî \\&quot;Paint\\&quot; \r<BR>\r<BR>Ïî Ïîñëåäîâàòåëüíîñòè Start (Ïóñê) -&gt;&gt;Ïðîãðàììû-&gt;&gt;Ñòàíäàðòíûå-&gt;&gt;Paint èëè åù¸ óäîáíåå \r<BR>Start (Ïóñê) -&gt;&gt; Run (Âûïîëíèòü) -&gt;&gt; íàïèñàâ mspaint ìîæåòå îòêðûòü ïðîãðàììó “Paint \r<BR>', 164, 'bor', 1, 0, 10, '', '', 13, '2014-11-01 01:40:54');
